import React from 'react';
import { useNavigate } from 'react-router-dom';
import './HomePage.css'; 

const HomePage = () => {
    const navigate = useNavigate();

    return (
        <div className="home-container">
            <h1>Hospital Management System</h1>
            
            <div className="dashboard">
                <div className="card" onClick={() => navigate('/patients')}>
                    <h2>Patients</h2>
                    <p>Manage patient records</p>
                </div>

                <div className="card" onClick={() => navigate('/medical-records')}>
                    <h2>Medical Records</h2>
                    <p>View and add medical records</p>
                </div>

                <div className="card" onClick={() => navigate('/add-patient')}>
                    <h2>Patient Registration</h2>
                    <p>Register a new patient</p>
                </div>

                <div className="card" onClick={() => navigate('/add-record')}>
                    <h2>Add Medical Record</h2>
                    <p>Add a new medical record</p>
                </div>

                <div className="card" onClick={() => navigate('/appointments')}>
                    <h2>Appointment Booking</h2>
                    <p>Book and manage appointments</p>
                </div>
            </div>
        </div>
    );
};

export default HomePage;
